舊名「那娘仔」的「朝陽里」位於宜蘭縣南澳鄉內，蘇花公路以東，南澳嶺南側至南澳溪北岸之間，為濱海平地，有朝陽漁港。清代稱「大南澳」，雖宣稱納入國土，但實為未治之番地。1914年日本政府理番成功之後，平地人始集體入墾，三年後將大南澳改列為一般行政區。今當地耆老習慣以「那娘仔」稱呼本地，應係浪速之訛音，緣由於1907年日治時期，日本軍艦「浪速丸」在台灣理蕃政策中曾停泊於南澳灣，為紀念浪速艦至此地協助理番，遂以「浪速」為地名(1917(大正6)年〈宜蘭廳報〉等文獻皆稱此地為”浪速”)，戰後改為「朝陽」。

